| 12 | I4 | relPosE |
| 16 | I4 | relPosD |
| 20 | I1 | relPosHPN |
| 21 | I1 | relPosHPE |
| 22 | I1 | relPosHPD |
| 23 | U1 | reserved2 |
| 24 | U4 | accN |
| 28 | U4 | accE |
| 32 | U4 | accD |
| 36 | X4 | flags |

**UBX-NAV-RELPOSNED-V1 (64 bytes, F9/newer):**
| Offset | Type | Name |
|--------|------|------|
| 0 | U1 | version (0x01) |
| 1 | U1 | reserved0 |
| 2 | U2 | refStationId |
| 4 | U4 | iTOW |
| 8 | I4 | relPosN |
| 12 | I4 | relPosE |
| 16 | I4 | relPosD |
| 20 | I4 | relPosLength |
| 24 | I4 | relPosHeading |
| 28 | U4 | reserved1 |
| 32 | I1 | relPosHPN |
| 33 | I1 | relPosHPE |
